var Datatype    = env.get("Datatype");
var Parameter   = env.get("Parameter");
var inicio      = msg.payload.indexOf("[")+1;
var fin         = msg.payload.indexOf("]");
var array       = msg.payload.slice(inicio,fin);
array           = array.split(',');
var intvalue = [];

for(var i=0; i<array.length; i++){
    array[i] = parseInt(array[i]);
    array[i] = array[i] << 8*i;
    // @ts-ignore
    intvalue = intvalue | array[i];
}
if(Datatype == "REAL"){
    msg.payload = parseFloat(Int2Float32(intvalue).toFixed(6));
}
else if(Datatype == "DINT"){
    msg.payload = parseInt(intvalue);
}
msg.parameter = Parameter;
return msg;

// IEC 754 to Float Function
function Int2Float32(bytes) {
    var sign = (bytes & 0x80000000) ? -1 : 1;
    var exponent = ((bytes >> 23) & 0xFF) - 127;
    var significand = (bytes & ~(-1 << 23));

    if (exponent == 128) 
        return sign * ((significand) ? Number.NaN : Number.POSITIVE_INFINITY);

    if (exponent == -127) {
        if (significand === 0) return sign * 0.0;
        exponent = -126;
        significand /= (1 << 22);
    } else significand = (significand | (1 << 23)) / (1 << 23);

    return sign * significand * Math.pow(2, exponent);
}
// Créditos: https://flows.nodered.org/flow/359ead34237b7ab6ec0465ee85a34b62

var InputSeconds = msg.payload;
if(InputSeconds >= 0){
    // si no genera numeros negativos
    var Days = parseInt(InputSeconds / 86400);
    var Hours = parseInt((InputSeconds - (Days) * 86400) / 3600);
    var SegRest = parseInt(InputSeconds - (Hours * 3600) - (Days * 86400));
    var Min = parseInt(SegRest / 60);
    var seconds = parseInt(SegRest - (Min * 60));

    // conversion a string
    Days = Days.toString()
    Hours = Hours.toString()
    Min = Min.toString()
    seconds = seconds.toString()
    //concatenacion
    var date = Days; date += ":"; date += Hours; date += ":"; date += Min; date += ":";date += seconds;
    // retornar el mensaje
    msg.payload = date;
    // guardar las variables
    context.set("Days", (Days),"memoryOnly");
    context.set("InputSeconds", InputSeconds, "memoryOnly");
    context.set("Hours", Hours, "memoryOnly");
    context.set("SegRest", SegRest, "memoryOnly");
    context.set("Min", Min, "memoryOnly");
    context.set("seconds", seconds, "memoryOnly");
    context.set("date", date, "memoryOnly");
    return msg;
}

