// (* 1. Buscar proedio de cargas de Upstroke *)
if (((TOS_b < No_Samples)&& (TOS_b>0))){
    for (let k = 0; k < TOS_b; k++) {
        AvgLoadUp = AvgLoadUp + CDF_EsfuOrd[k];
    }

    for (let k = TOS_b; k < No_Samples; k++) {
        AvgLoadDown = AvgLoadDown + CDF_EsfuOrd[k];
    }
    AvgLoadUp = AvgLoadUp / ((TOS_b + 1));
