    global.set("SensorLess.CargaCompresion2", CargaCompresion2);
}
// (* 4. Busqueda de indices TP`s*)
for (let k = 0; k < No_Samples; k++) {
    if (CDF_EsfuOrd[k] > AvgLoadUp && Aux11 == false){
        Ind_1 = k;
        Aux11 = true;
    }
    if (CDF_EsfuOrd[k] < AvgLoadUp && Aux11 == true && Aux12 == false){
