    Llenado5 = ((CDF_DespOrd[Ind_9] - CDF_DespOrd[Ind_10]) - Min_Stroke_b) / (Max_Stroke_b - Min_Stroke_b);

}
if (Min_Carga_b < 0){
    Llenado_Ordenamiento = ((Llenado1 + Llenado2 + Llenado3 + Llenado4 + Llenado5) / 5.0) * 100.0;
}else{
    Llenado_Ordenamiento = ((Llenado1 + Llenado2 + Llenado3) / 3.0) * 100.0;
}
PuntoTrans_Ordenamiento = ((Max_Stroke_b - Min_Stroke_b) * Llenado_Ordenamiento) / 100.0;
// -------------------------------------------------------------------------------------------------------------------
