var Sumergencia = 0, Altura_Crudo = 0, DescargaBomba = [], PIP_Instantaneo2 = [], PIP_MaxPend = 0, PIP_ActualPend = 0, PIP_MaxPend_Indice = 0, PIP_MaxPend_Value = 0;
