// (* Tiempo efectivo *)
Tiempo_Efectivo = (Pos_Min_Derivada + 1) * dT_Position_X;
// (* Calcular potencia de la bomba - Ecuacion No.1 *)
Area_Dinag = Min_Stroke_b;

for (let c4 = 0; c4 < No_Samples -1; c4++) {
    Area_Dinag = Area_Dinag + CDF_DespOrd[c4 + 1] * CDF_EsfuOrd[c4] - CDF_DespOrd[c4] * CDF_EsfuOrd[c4 + 1];
}
Area_Dinag = Math.abs(0.5 * (Area_Dinag + CDF_DespOrd[1] * CDF_EsfuOrd[(No_Samples - 1)] - CDF_DespOrd[(No_Samples - 1)] * CDF_EsfuOrd[1])); //(* Unidad de medida: K * Lb * ft *in *)
Area_Dinag = parseFloat(Area_Dinag.toFixed(4));//redondeo a 4 cifras decimales

Ppump_KW = (1.88307 * Math.pow(10.0, -3.0)) * Area_Dinag * SPM; //(* KW *)
Ppump_Hp = Ppump_KW * 1.34102; //(* Hp *)

// (* Calcular potencia de la bomba - Ecuacion No.2 *)

for (let c5 = 0; c5 <= No_Samples - 2; c5++) {
    Promedio_Potencias = ((CDF_EsfuOrd[c5] + CDF_EsfuOrd[c5 + 1]) * 1000.0) / 2.0;
    Array_Potencia[c5] = (1.129 * Math.pow(10.0, -4.0)) * Promedio_Potencias * Array_Velocidad_DF[c5];
    Ppump = Array_Potencia[c5] + Ppump;
}

if(No_Samples != 0){//promedio
    Ppump = Ppump / (No_Samples);
}

// (* Calcular Q's*)
Q_Efectivo = FP * (PointTransfer - Min_Stroke_b) * SPM;
Q_Neto     = FP * Max_Stroke_b * SPM;

Periodo_Stroke = 60.0 / SPM_Feedback;

if(Periodo_Stroke != 0 && Max_Stroke_b != 0){
    Q_Ideal = 8.9054 * (PointTransfer / Max_Stroke_b) * Area_Piston * (Max_Stroke_b / Periodo_Stroke);
}

// (* Calcular Q teorico -> i *)

for (let c3 = 0; c3 < No_Samples -1; c3++) {
    Q_Efectivo_Instantaneo[c3] = 8.9054 * Area_Piston * Array_Velocidad_DF[c3]; //(**)
    if (PointTransfer != 0){
        Q_Efectivo_Avg[c3] =  (8.9054 * Area_Piston * Array_Velocidad_DF[c3]) / PointTransfer;
        Q_Teorico_m = Q_Teorico_m + Q_Efectivo_Avg[c3];
    }
}
// (* Calcular Q teorico -> m *)

Q_Teorico_m = Q_Teorico_m / ((No_Samples));
Q_Teorico_Promedio = Q_Teorico_m;

// (* Calcular DP Bomba - No.1 - Qefectivo *)

if (Q_Efectivo != 0){
    DP_bomba_1_effective = (Ppump / Q_Efectivo) * 78819.0;
}

// (* Calcular DP Bomba - No.1 - Qteorico *)
if(Q_Ideal != 0){
    DP_bomba_1_teorico = (Ppump / Q_Ideal) * 78819.0;
}

// (* Calcular DP Bomba - No.1 - Qmedido *)

if (Q_Medido != 0){
    DP_bomba_1_medido = (Ppump / Q_Medido) * 78819.0;
}

// (* Calcular DP Bomba - No.2 *)
if (Q_Ideal != 0){
    DP_bomba_2 = (Prom_Esfuerzo / Q_Ideal) * 78819.0;
}

// (* Volumen de un stroke *)
Volumen_stroke = 9714.0 * Math.pow(10.0, -7.0) * ((PointTransfer - Min_Stroke_b) / 12.0) * Math.pow(D_Piston, 2.0);

// (* Volumen diario *)
Volumen_diario = Volumen_stroke * SPM * 60.0 * 24.0;

// (* Calcular GEo *)
GEo = (141.5 / (131.5 + API));

// (* Calcular SGo_w *)
SGo_w = 0.052 * 8.345 * GEo;

// (* Calcular DenO *)
DenO = GEo * DenW;

// (* Calcular WOR *)
if (Prod_Crudo != 0){
    WOR = Prod_Agua / Prod_Crudo;
}
// (* Calcular SpGrt *)
SpGrt = (GEo / (1.0 + WOR)) + ((SpGrw * WOR) / (1.0 + WOR));

// (* Calcular HS Teorico *)
if (SpGrt != 0){
    HS_teorico= (1.72 / SpGrt) * DP_bomba_1_teorico;
    // (* Calcular HS Efectivo *)
    HS_efectivo= (1.72 / SpGrt) * DP_bomba_1_effective;
    // (* Calcular HS Medido *)
    HS_medido= (1.72 / SpGrt) * DP_bomba_1_medido;
}

// (* Calcular NF Teorico *)
NF_teorico = Pb - HS_teorico;//pf Profund_Intake

// (* Calcular NF Efectivo *)
NF_efectivo = Pb - HS_efectivo;

// (* Calcular NF Medido *)
NF_medido = Pb - HS_medido;

Prod_Liquido = Prod_Crudo + Prod_Agua;
// (* Calculando WC *)
if (Prod_Liquido != 0){
    WC = (Prod_Agua / Prod_Liquido) * 100.0;
}

// (* Calculando densidad del crudo *)
D_oil = GEo * D_water;

// (* Calculando densidad del liquido *)
D_liquid = (D_oil * (1.0 - (WC / 100.0))) + (D_water * (WC / 100.0));

// (* Potencia hidraulica *)
Pot_Hidraulica = (DP_bomba_1_effective * Q_Medido) / 78819.0;

// (* Calculo de PIP instantane *)
for (let c6 = 0; c6 <= No_Samples - 1; c6++) {
    if(Area_Piston != 0){
        PIP_Instantaneo[c6]  = (CDF_EsfuOrd[c6] * 1000.0) / Area_Piston;
        PIP_Instantaneo_Prom = PIP_Instantaneo_Prom + PIP_Instantaneo[c6];
    }
}

PIP_Instantaneo_Prom = PIP_Instantaneo_Prom / (PIP_Instantaneo.length);

// (* Velocidad el Polished Rod *)

for (let c6 = 0; c6 <= No_Sartas - 1; c6++) {
    W_Sarta[c6] = parDinagram['Sarta' + (c6 + 1)].Peso_Inicial_Ca;
    E = parDinagram['Sarta' + (c6 + 1)].E;
    Diametro_Sarta[c6] = parDinagram['Sarta' + (c6 + 1)].Diametro_Pulg;
    if (W_Sarta[c6] != 0){
        Velocidad_Sarta = (Diametro_Sarta[c6] / 2.0) * (Math.sqrt((Math.PI * E * g) / W_Sarta[c6]));
        Prom_Velocidad_Sarta = Prom_Velocidad_Sarta + Velocidad_Sarta;
    }
}

if (No_Sartas != 0){
    Prom_Velocidad_Sarta = Prom_Velocidad_Sarta /(No_Sartas);
    Prom_Velocidad_Sarta = parseFloat(Prom_Velocidad_Sarta.toFixed(4));//redondeo a 4 cifras decimales
}

// (* VECTOR DE VELOCIDAD *) Calculos de Superficie POU Lader 4G
for (let i = 0; i < Desp_CD.length -1; i++) {
    if ((i == 0) && (dT_Position_X != 0)){//primera posición
        Array_Velocidad_DS[i] = (Desp_CD[(Desp_CD.length - 1)] - Desp_CD[0]) / dT_Position_X;
    }else if( i > 0 && dT_Position_X != 0){
        Array_Velocidad_DS[i] = (Desp_CD[i] - Desp_CD[(i - 1)]) / dT_Position_X;
    }
}

// Top of stroke superficie
Max_Desp_s = Desp_CD[0];//inicializacion de la variable
for (let i = 0; i < Desp_CD.length; i++) {
    if (Desp_CD[i] > Max_Desp_s){
        Max_Desp_s = Desp_CD[i];
        TOS_s = i;
    }
}

// (* Promedio de la velocidad de subida *) Calculos de Superficie POU Lader 4G
for (let j = 0; j < TOS_s; j++) {
    Vel_Prom_Subida = (Array_Velocidad_DS[j]) + Vel_Prom_Subida;
}
Vel_Prom_Subida = Vel_Prom_Subida / (TOS_s + 1);


// (* Factor de amortiguamiento - No.1 *)
factorA = 1.360946 * (Math.pow(Vel_Prom_Subida, -0.5));
factorB = 1.380512 * (Math.pow(Vel_Prom_Subida, -0.75));
factorC = 0.230365 * (Math.pow(Vel_Prom_Subida, -1.0));

Y_exp_1 = Fc * (0.397345 - factorA + factorB - factorC);

for (let i = 0; i < No_Sartas; i++) {
    Lrod = parDinagram['Sarta' + (i + 1)].Longitud_Tr_Ft + Lrod;
}

if (Lrod != 0){
    C_exp_1 = (Math.PI * Prom_Velocidad_Sarta * Y_exp_1) / (2.0 * Lrod);
}

// (* Factor de Amortiguamiento - No.2 *)
Y_exp_2 = ((4.42 * Math.pow(10.0, -2.0)) * Lrod * (Ppump - Pot_Hidraulica) * 1.34102 * (Math.pow(Periodo_Stroke, 2.0))) / (((1200.0 * 0.601) + (3875.0 * 0.442)) * Math.pow((100.0 / 12.0), 2.0));

if(Lrod != 0){
    C_exp_2 = (Math.PI * Prom_Velocidad_Sarta * Y_exp_2) / (2.0 * Lrod);
}

// (* Factor de friccion *)
for (let c9 = 0; c9 < No_Sartas; c9++) {
    Area_Cabilla = Area_Cabilla + ((3.14159 / 4.0) * Math.pow(Diametro_Sarta[c9], 2.0));
}



if (No_Sartas  != 0 && g != 0 && Lrod != 0){
    Area_Cabilla = Area_Cabilla / (No_Sartas);
    D_Cabillas = parDinagram['Sarta' + No_Sartas].Densidad
    FF_1 = (Math.PI * Prom_Velocidad_Sarta * Y_exp_2 * D_Cabillas * Area_Cabilla) / (288.0 * g * Lrod);
    FF_2 = Lrod * Vel_Prom_Subida;
}

u_Friccion = FF_1 * FF_2;


// (* CARGA SOBRE LA BOMBA(F0) en Klb *)
var CDF_EsfuOrd = global.get("SensorLess.CDF_EsfuOrd") || [];


context.set("Dinagrama", Dinagrama, "memoryOnly");

var MinFuerza1F = CDF_EsfuOrd[0];
var MaxFuerza1F = CDF_EsfuOrd[0];

for (let i = 0; i < CDF_EsfuOrd.length; i++) {
    if (CDF_EsfuOrd[i]>MaxFuerza1F){
        MaxFuerza1F = CDF_EsfuOrd[i];
    }
    if (CDF_EsfuOrd[i] < MinFuerza1F){
        MinFuerza1F = CDF_EsfuOrd[i];
    }
}

// # =============== calculo de derivada de la carga para hallar el Fo =====#
var dt = 2,derload = [];

for (let i = 0; i < CDF_EsfuOrd.length; i++) {
    if(i == 0){
        derload[i] = (CDF_EsfuOrd[CDF_EsfuOrd.length - 1] - CDF_EsfuOrd[0]) / (dt)
    }else{
        derload[i] = (CDF_EsfuOrd[i] - CDF_EsfuOrd[i - 1]) / (dt)
    }

}
derload[CDF_EsfuOrd.length - 1] = derload[0];
var maxload = (3 / 4) * MaxFuerza1F
context.set("7Fo.derload", derload,"memoryOnly");
context.set("7Fo.maxload", maxload,"memoryOnly");

var FoAux = 0
var p_inicial_Fo = 0

for (let i = 0; i < TOS_b; i++) {
    if (derload[i] < 0 && FoAux == 0){
        FoAux = 1;
        p_inicial_Fo = i;
        if (MaxFuerza1F > CDF_EsfuOrd[i]){
            FoAux = 0;
        }
    }
}
context.set("7Fo.FoAux", FoAux,"memoryOnly");
context.set("7Fo.p_inicial_Fo", p_inicial_Fo,"memoryOnly");
context.set("7Fo.TOS_b", TOS_b,"memoryOnly");
context.set("7Fo.MaxFuerza1F", MaxFuerza1F,"memoryOnly");


// #metodo promedio puntos máximos Joselito lo hizo
var promloadUP_1 = 0

for (let i = p_inicial_Fo; i < TOS_b; i++) {
    promloadUP_1 = promloadUP_1 + CDF_EsfuOrd[i];
}

promloadUP_1 = promloadUP_1 / (TOS_b - p_inicial_Fo);
context.set("7Fo.promloadUP_1", promloadUP_1,"memoryOnly");

var promloadDOWN_1 = 0;


for (let i = IndiceTP; i < CDF_EsfuOrd.length; i++) {
    promloadDOWN_1 = promloadDOWN_1 + CDF_EsfuOrd[i]
}

promloadDOWN_1 = promloadDOWN_1 / (CDF_EsfuOrd.length - IndiceTP);

context.set("7Fo.VectorCargaPosTB", CDF_EsfuOrd[IndiceTP],"memoryOnly");
context.set("7Fo.IndiceTP", IndiceTP,"memoryOnly");
context.set("7Fo.promloadDOWN_1", promloadDOWN_1,"memoryOnly");

Fo = promloadUP_1 - promloadDOWN_1;
context.set("7Fo.Fo", Fo,"memoryOnly");



// (* Calcular caida de presion en Standing Valve *)

if (Area_Piston !=  0){
    DP_sv = (Fo / Area_Piston) - DP_bomba_1_effective;
}




// (* Calcular diferencial de presion *)
D_Presion = Pd - PIP;

if(D_liquid != 0){
    // (*============= SUMERGENCIA ===========*)
    Sumergencia = (PIP - PresionCasing) / (0.433 * D_liquid);
    // (*============= CALCULO DE NIVEL DE FLUIDO DINAMICO ===========*)
    Altura_Crudo = L_perforacion - ((PIP - PresionCasing) / (0.4337 * (D_liquid)));//nivel de fluido
    // node.status({fill:"red",shape:"ring",text:"sub" + Sumergencia + "Altura " + Altura_Crudo});
}

// (* Vector de presion de descarga de la bomba *)

for (let c9 = 0; c9 < No_Samples -1; c9++) {
    if (Q_Efectivo_Instantaneo[c9] != 0){
        DescargaBomba[c9]      = (Array_Potencia[c9] / Q_Efectivo_Instantaneo[c9]) * 78819.0;
        DescargaBomba_Promedio = DescargaBomba_Promedio + DescargaBomba[c9];
    }
}
DescargaBomba.shift();// eliminar la primera posicion del vector
DescargaBomba_Promedio = DescargaBomba_Promedio / (No_Samples);
// node.status({ fill: "red", shape: "ring", text: DescargaBomba_Promedio});



// (* Vector de PIP2 *)

for (let c9 = 0; c9 < DescargaBomba.length; c9++) {
    PIP_Instantaneo2[c9] =  Pressure_Tubing + (0.4337 * D_liquid * Pb) - DescargaBomba[c9];
    PIP_Promedio2 = PIP_Promedio2 + PIP_Instantaneo2[c9];
    // node.status({ fill: "red", shape: "ring", text: "ctr" + c9 + "dimension" + DescargaBomba.length});
    if (PIP_Instantaneo2[c9] < MinPIP){
        MinPIP = PIP_Instantaneo2[c9];
    }
    if (PIP_Instantaneo2[c9] > MaxPIP){
        MaxPIP = PIP_Instantaneo2[c9];
    }
}

PIP_Instantaneo2[PIP_Instantaneo2.length - 2] = PIP_Instantaneo2[1];//cerrar el vector
PIP_Instantaneo2[PIP_Instantaneo2.length - 1] = PIP_Instantaneo2[0];

PIP_Promedio2 = PIP_Promedio2 / (No_Samples);

// (* Calculo de la maxima pendiente del dinagrama del PIP respecto a una posición *)

for (let c9 = 0; c9 <= No_Samples - 5; c9++) {
    if (((CDF_DespOrd[c9 + 1] - CDF_DespOrd[c9]) != 0)){
        PIP_ActualPend = (PIP_Instantaneo2[c9 + 1] - PIP_Instantaneo2[c9]) / (CDF_DespOrd[c9 + 1] - CDF_DespOrd[c9]);
    }
    if (PIP_ActualPend > PIP_MaxPend){
        PIP_MaxPend = PIP_ActualPend;
        PIP_MaxPend_Indice = c9;
    }
}
PIP_MaxPend_Value = PIP_Instantaneo2[PIP_MaxPend_Indice];

// (* Calculo de Nivel de Fluido Dinamico(Array) *)
for (let c9 = 0; c9 < PIP_Instantaneo2.length; c9++) {
    NFD_Instantaneo[c9] = L_perforacion - ((PIP_Instantaneo2[c9] - PresionCasing) / (0.4337 * (D_liquid)));
    NFD_Promedio = NFD_Promedio + NFD_Instantaneo[c9];
    if (NFD_Instantaneo[c9] < NFD_Min){
        NFD_Min = NFD_Instantaneo[c9];
    }
    if (NFD_Instantaneo[c9] > NFD_Max){
        NFD_Max = NFD_Instantaneo[c9];
    }

}
NFD_Promedio = NFD_Promedio / (PIP_Instantaneo2.length);//promedio

// (* Calculo de la sumergencia *)

for (let c9 = 0; c9 < NFD_Instantaneo.length ; c9++) {
    Sumergencia_Inst[c9] = L_perforacion - NFD_Instantaneo[c9];
    Sumergencia_Prom     = Sumergencia_Prom + Sumergencia_Inst[c9];
    if (Sumergencia_Inst[c9] < MinSumergencia){
        MinSumergencia = Sumergencia_Inst[c9];
    }
    if (Sumergencia_Inst[c9] > MaxSumergencia){
        MaxSumergencia = Sumergencia_Inst[c9];
    }
}
Sumergencia_Prom = Sumergencia_Prom / (Sumergencia_Inst.length);//empieza desde cero

// (*================= CALCULO DE PRESION DE DESCARGA ==============*)
Pd = Pressure_Tubing + (Pb * 0.433 * D_liquid);
Pd = parseFloat(Pd.toFixed(4));//redondeo a 4 cifras decimales

context.set("8Pd.Pd", Pd,"memoryOnly");
context.set("8Pd.Pb", Pb,"memoryOnly");
context.set("8Pd.Pressure_Tubing", Pressure_Tubing,"memoryOnly");
context.set("8Pd.D_liquid", D_liquid,"memoryOnly");

// (*================= PRESION DE ENTRADA A LA BOMBA ==============*)
if(Area_Piston != 0){
    // PIP = Pd - ((Fo * 1000.0) / Area_Piston) - (0.433 * D_liquid * Sumergencia_Prom);//jose Validación
    PIP = Pd - ((Fo * 1000.0) / Area_Piston);
    PIP = parseFloat(PIP.toFixed(4));//redondeo a 4 cifras decimales
   node.status({ fill: "red", shape: "ring", text: "Pd" + Pd + " PIP " + PIP + " constante :" + ((Fo * 1000.0) / Area_Piston)});
}else{
    node.status({ fill: "red", shape: "ring", text: "no Areia piston"});
}



// (* Calcular PWF instantaneo *)
for (let c9 = 0; c9 < DescargaBomba.length; c9++) {
    PWF_Inst[c9] = PresionCasing + (0.4337 * D_liquid * L_perforacion) - DescargaBomba[c9];
    PWF_Inst_Prom = PWF_Inst_Prom + PWF_Inst[c9];
}
PWF_Inst_Prom = PWF_Inst_Prom / (PWF_Inst.length + 1);//empieza desde cero

// (* CALCULO DE LA PRESION DE FONDO FLUYENTE *)

// PWF = PresionCasing + (L_perforacion * 0.433 * D_liquid) - ((Fo * 1000.0) / Area_Piston);
// actualización Jose
