var Max_Desp_s = 0;
var Min_Desp_s = 0;
var Max_Carga_s = 0;
var Min_Carga_s = 0;

//Se inicializa las variables con el valor de la posición 0 de cada vector.
Max_Desp_s = Desp[0];
Min_Desp_s = Desp[0];
Max_Carga_s = Esf[0];
Min_Carga_s = Esf[0];
//&& 
//&&  
if (habilitadoCS == true && comunicacion == true && Start_SurfaceControl == true) {
    //visualizar estado del habilitado
    node.status({ fill: "green", shape: "dot", text: "habilitado" });

    if (Disparo == false) {
        if (POC_actual >= Num_intentos) {
            POC_actual = 0;
            flow.set("POC_actual", POC_actual);
        }

        //Encontrar el valor maximo y minimo del vector X.
        for (var i = 0; i < Desp.length; i++) {
            if (Desp[i] > Max_Desp_s) {
                Max_Desp_s = Desp[i];
            }
            if (Desp[i] < Min_Desp_s) {
                Min_Desp_s = Desp[i];
            }
        }
        context.set("Min_Desp_s", Min_Desp_s);//Seteo el minimo valor del vector X
        context.set("Max_Desp_s", Max_Desp_s);//Seteo el maximo valor del vector X

        //Calcula el valor de X real
        Point_X_Real = (((Max_Desp_s - Min_Desp_s) * Porcentaje_X) / 100.0) + Min_Desp_s;
        flow.set("Point_X_Real", Point_X_Real);//Seteo el valor hallado en la anterior ecucación

        //Recorre el vector en busca del punto up y del punto down
        for (var j = 0; j < Desp.length; j++) {
            if (Actual_pos < Desp[j]) {
                if (Actual_pos > Point_X_Real && POC_aux == false) {
                    POC_aux = true;
                    POC_indice = j;
                    context.set("POC_indice", POC_indice);
                }
            }
            if (Actual_pos > Desp[j] && POC_aux == true) {
                if (Actual_pos < Point_X_Real && POC_aux2 == false) {
                    POC_aux2 = true;
                    POC_indice2 = j;
                    context.set("POC_indice2", POC_indice2);
                }

            }
            Actual_pos = Desp[j];
            flow.set("Actual_pos", Actual_pos);//Setea el valor que esta en la posición j del vector Y
        }

        POC_aux = false;//Indica evaluar de nuevo
        flow.set("POC_aux", POC_aux);
        POC_aux2 = false;//Indica evaluar de nuevo
        flow.set("POC_aux2", POC_aux2);

        //Indicar los puntos de up stroke y down stroke
        POC_carga_arriba = Esf[POC_indice];//up
        flow.set("POC_carga_arriba", POC_carga_arriba);
        POC_carga_abajo = Esf[POC_indice2];//down
        flow.set("POC_carga_abajo", POC_carga_abajo);

        //Encontrar el valor maximo y minimo del vector Y.
        for (var k = 0; k < Esf.length; k++) {
            if (Esf[k] > Max_Carga_s) {
                Max_Carga_s = Esf[k];
            }
            if (Esf[k] < Min_Carga_s) {
                Min_Carga_s = Esf[k];
            }
        }
        context.set("Min_Carga_s", Min_Carga_s);                             //Seteo el minimo valor del vector Y
        context.set("Max_Carga_s", Max_Carga_s);                             //Seteo el maximo valor del vector Y

        //Calcular el valor de Y real
        Point_Y_Real = (((Max_Carga_s - Min_Carga_s) * Porcentaje_Y) / 100.0) + Min_Carga_s;
        flow.set("Point_Y_Real", Point_Y_Real);//Seteo el valor hallado en la anterior ecucación

        //Evaluar si el punto esta por fuera o por dentro.
        if (Point_Y_Real > POC_carga_arriba || Point_Y_Real < POC_carga_abajo) {
            var POC_trigger = true;                                             //Define si el punto está por fuera o por dentro
            context.set("POC_trigger", POC_trigger);
            node.status({ fill: "red", shape: "dot", text: "Fuera del rango" });
            Alert_Dinagrama2 = { payload: "Fuera del rango" };
        } else {
            POC_trigger = false;   
            POC_actual = 0;
            flow.set("POC_actual", POC_actual);                                             //Indica que el punto esta dentro del rango
            node.status({ fill: "green", shape: "dot", text: "punto dentro del rango" });
            Alert_Dinagrama2 = { payload: "Dentro del rango" };
            Alert_Dinagrama = { payload:"Optimo"}
        }
        //Contar el número de intentos
        if (POC_actual <= Num_intentos) {
            if (POC_trigger == true) {
                POC_actual += 1;
                flow.set("POC_actual", POC_actual);
                Alert_intentos = { payload: POC_actual };
            } else {
                POC_actual = 0;
                flow.set("POC_actual", POC_actual);
            }
        }

        POC_trigger = false
        context.set("POC_carga_arriba", POC_carga_arriba);
        context.set("Point_Y_Real", Point_Y_Real);



        //Dsiparosi sobrepasa el número de intentos
        if (POC_actual >= Num_intentos) {
            Alert_Dinagrama = { payload: "Ha superado  el número de intentos, se apagará el equipo" };
            Disparo = true;//activa el disparo
            flow.set("Control_functions.SurfaceControl.Disparo", Disparo, "memoryOnly");
            Estado_Dinagrama = {payload:false};//Apaga el equipo
            POC_actual = 0;
            flow.set("POC_actual", POC_actual);
            Alert_intentos = { payload: Num_intentos };

        }
        return [Disparo, Estado_Dinagrama, Alert_Dinagrama, Alert_Dinagrama2, Alert_intentos];

    }


}else if (habilitadoCS == false) {
    POC_actual = 0;
    Estado_Dinagrama = {payload:"...."};
    flow.set("POC_actual", POC_actual);
    Alert_Dinagrama2 = {payload:"....."};
    Alert_intentos = {payload:POC_actual};
