// función de filtro
function Savgol(X, caso = 3) {
    //desarrollado por el ing Jose
    var k = 0;
    var y = [];

    switch (caso) {
        case 1:
            for (let i = 2; i < X.length - 2; i++) {
                y[k] = (1 / 35) * (-3 * X[i - 2] + 12 * X[i - 1] + 17 * X[i] + 12 * X[i + 1] - 3 * X[i + 2]);
                k = k + 1;
            }
            break;
        case 2:
            for (let i = 3; i < X.length - 3; i++) {
