var A = parseFloat(global.get("GeometriaSucket.tablaGeometria.A"));
var R = parseFloat(global.get("GeometriaSucket.tablaGeometria.R"));


// variables de la función HMI poner las que son
var GB = 320000; //#GearBox
var SU = 550;
var Beam = 29800;
var T_cbmax = 705954.7;

var T_cb = [], TF = [], PL = [];
for (let i = 0; i < theta.length; i++) {
    T_cb[i] = T_cbmax * Math.sin(theta[i]);
    TF[i] = (R * A * Math.sin(alpha[i])) / (C *  Math.sin(beta[i]));//Torque Factor
    PL[i] = SU + ((GB + T_cb[i]) / TF[i]);//PermiseFlow
    if(PL[i] > Beam){
        PL[i] = Beam;
    }else if(PL[i]<= 0){
        PL[i] = 0;
    }
    // escalizarlo a la carga del sistema
    PL[i] = PL[i]/1000;
}

