var Tipo      = global.get("GeometriaSucket.tablaGeometria.Tipo")||0;//Selección del Tipo Balancin
var FuenteCalculo = global.get("GeometriaSucket.FuenteCalculo")||0;//Selección del Tipo Balancin
Tipo = Tipo.toUpperCase();
FuenteCalculo = FuenteCalculo.toUpperCase();
var CW        = global.get("GeometriaSucket.CW") || -1; // 1. horario positivo // -1.antihorario negativo
var A         = parseFloat(global.get("GeometriaSucket.tablaGeometria.A"));
var I         = parseFloat(global.get("GeometriaSucket.tablaGeometria.I"));
var H         = parseFloat(global.get("GeometriaSucket.tablaGeometria.H"));
var G         = parseFloat(global.get("GeometriaSucket.tablaGeometria.G"));
var C         = parseFloat(global.get("GeometriaSucket.tablaGeometria.C"));
var P         = parseFloat(global.get("GeometriaSucket.tablaGeometria.P"));
var R         = parseFloat(global.get("GeometriaSucket.tablaGeometria.R"));

// dimensiones del vector de geometria
var vectorPotencia = global.get("Dinagrama.superficie.strokePotencia");
var Desp_CD = global.get("Dinagrama.superficie.Desp_CD");
var Nmuestras = 0 ;

if (FuenteCalculo.includes('SENSORLESS')){//Numero de muestras por sensor Potencia
    Nmuestras = vectorPotencia.length ;

} else if (FuenteCalculo.includes('SENSORFISICO')){// numero de muestras por sensor de posicion
    Nmuestras = Desp_CD.length ;
} else if (FuenteCalculo.includes('TWM')){// numero de muestras por sensor de posicion
    Nmuestras = Desp_CD.length ;
}

//Declaración de variables para ecuaciones
var K = 0, PHIt = 0, THETAktopt = 0, tetha_top = 0, theta = [], thetaK = [], beta = [],Y_bt = 0, Y_tt = 0 ;
var J = [],Y = [],alpha = [], s_pr = [];

// Cálculo de K
K = Math.sqrt(Math.pow(I, 2) + Math.pow((H - G), 2));

// Creacion del vector de ángulo theta(θ) de 0 a 2*pi
var paso = (2*Math.PI)/Nmuestras;
theta[0] = 0;
for (let i = 1; i < Nmuestras; i++) {
    theta[i] = theta[i - 1] + paso;
}

//Cálculo de ángulos dependiendo del Tipo de geometría del Machine
if(Tipo.includes('CONVENCIONAL')){ // Si es de Tipo Convencional
    // node.status({fill:"blue",shape:"ring",text:"convensional"});
    PHIt = Math.asin(I/K);
    THETAktopt = Math.acos((Math.pow(K,2) + Math.pow((R+P),2) - Math.pow(C,2))/(2*K*(R+P)));
    PHIt < THETAktopt ? tetha_top = PHIt - THETAktopt : tetha_top = PHIt + THETAktopt;
    //Cálculo de  vectores
    for (let i = 0; i < Nmuestras; i++) {
        thetaK[i] = theta[i] - (parseInt(CW) * PHIt);
        Y_bt = Math.acos((Math.pow(C, 2) + Math.pow(K, 2) - Math.pow((P + R), 2)) / (2 * C * K));
        Y_tt = Math.acos((Math.pow(C, 2) + Math.pow(K, 2) - Math.pow((P - R), 2)) / (2 * C * K));
        J[i] = Math.sqrt(Math.pow(K, 2) + Math.pow(R, 2) - (2 * K * R * Math.cos(thetaK[i])));
        beta[i] = Math.acos((Math.pow(C, 2) + Math.pow(P, 2) - Math.pow(J[i],2)) / (2 * C * P));
        Y[i] = Math.acos((Math.pow(C, 2) + Math.pow(J[i], 2) - Math.pow(P, 2)) / (2 * C * J[i])) - Math.asin((R / J[i]) * Math.sin(thetaK[i]));
        alpha[i] = beta[i] + Y[i] - (theta[i] - PHIt);
        s_pr[i] = A * (Y_bt - Y[i]);
    }
} else if (Tipo.includes('MARK')) { // Si es de Tipo Mark II
    // node.status({fill:"blue",shape:"ring",text:"MARKII"});
    PHIt = Math.atan(I/(H-G)) + Math.PI;
    THETAktopt = Math.acos((Math.pow(K,2) + Math.pow((P + R), 2) - Math.pow(C,2)) / (2 * K * (P - R)));
    tetha_top = THETAktopt - (PHIt - Math.PI);
    //Cálculo de  vectores
    for (let i = 0; i < Nmuestras; i++) {
        thetaK[i] = theta[i] - (parseInt(CW) * PHIt);
        Y_bt = Math.acos((Math.pow(C, 2) + Math.pow(K, 2) - Math.pow((P - R), 2)) / (2 * C * K));
        Y_tt = Math.acos((Math.pow(C, 2) + Math.pow(K, 2) - Math.pow((P + R), 2)) / (2 * C * K));
        J[i] = Math.sqrt(Math.pow(K, 2) + Math.pow(R, 2) - (2 * K * R * Math.cos(thetaK[i])));
        beta[i] = Math.acos((Math.pow(C, 2) + Math.pow(P, 2) - Math.pow(J[i],2)) / (2 * C * P));
        Y[i] = Math.asin((P * Math.sin(beta[i])) / J[i]) - Math.asin((R / J[i]) * Math.sin(theta[i] - PHIt));
        alpha[i] =  - beta[i] - Y[i] + (theta[i] - PHIt);
        s_pr[i] = - A * (Y_bt - Y[i]);
    }
} else if (Tipo.includes('AIR')) { // Si es de Tipo Airbalance
    PHIt = Math.PI - Math.atan(I/(H-G));
    THETAktopt = Math.acos((Math.pow(K, 2) + Math.pow((P - R), 2) - Math.pow(C, 2)) / (2 * K * (P - R)));
    //Cálculo de  vectores
    for (let i = 0; i < Nmuestras; i++) {
        thetaK[i] = theta[i] - (parseInt(CW) * PHIt);
        Y_bt = Math.acos((Math.pow(C, 2) + Math.pow(K, 2) - Math.pow((P - R), 2)) / (2 * C * K));
        Y_tt = Math.acos((Math.pow(C, 2) + Math.pow(K, 2) - Math.pow((P + R), 2)) / (2 * C * K));
        J[i] = Math.sqrt(Math.pow(K, 2) + Math.pow(R, 2) - (2 * K * R * Math.cos(thetaK[i])));
        beta[i] = Math.acos((Math.pow(C, 2) + Math.pow(P, 2) - Math.pow(J[i],2)) / (2 * C * P));
        Y[i] = Math.asin((P * Math.sin(beta[i])) / J[i]) + Math.asin(R / J[i] * Math.sin(thetaK[i] - PHIt));
        alpha[i] =  beta[i] + Y[i] + (theta[i] - PHIt);
        s_pr[i] =- A * (Y_bt - Y[i]);
    }
}
